var util           = require("util");
var ResponseHeader = require("../response");

function WwwAuthenticateHeader(value) {
    ResponseHeader.call(this, value);
}

util.inherits(WwwAuthenticateHeader, ResponseHeader);

WwwAuthenticateHeader.prototype.getKey = function() {
    return "WWW-Authenticate";
};

module.exports = WwwAuthenticateHeader;
